social_posts.post_text:
As I finished up my college volleyball career I wasn’t sure how I was going to feel… after a few days now, I’m honestly just filled with gratitude. All of the amazing women & coaches I have met along the way are unmatched. The lessons I’ve learned, the memories I’ve made & the friendships that have been created will last a lifetime and I am just so grateful. It was not always easy, but it was always worth it. 
@gophervball I owe a special thank you to you all. This program is so special and I can’t wait to see the success of this program moving forward. I am so thankful I got to be a Gopher even though it was only a short period of time. Thank you for accepting me & allowing me to play the game I love one more time 🤍🤍 
#6 is outta here😢… for now
